import styled from 'styled-components/native';

export const Container = styled.View`
width: 100%;
height: 80%;
align-items: center;
flex: 1;
flex-direction: row;
justify-content: center;
background-color: #dbdbdb;
`;

export const Squares = styled.View`
flex: 1;
flex-direction: row;
align-items: center;
justify-content: center;
margin-bottom: 10px;
`;

export const Square = styled.TouchableOpacity`
background-color: #677689;
width: 150px;
height: 150px;
elevation: 9;
border-radius: 5px;
margin: 10px;
`;
